import sys

n = int(sys.stdin.readline().strip())
a = []
for i in range(n):
    a.append(int(sys.stdin.readline().strip()))

clockwise = 0
counterclockwise = 0

for i in range(n):
    if a[i] > 90 and a[i] < 180:
        clockwise += a[i] - 90
    elif a[i] > 180 and a[i] < 270:
        clockwise += a[i] - 180
    elif a[i] > 270 and a[i] < 360:
        clockwise += a[i] - 270
    elif a[i] > 0 and a[i] < 90:
        counterclockwise += 90 - a[i]
    elif a[i] > 0 and a[i] < 180:
        counterclockwise += 180 - a[i]
    elif a[i] > 0 and a[i] < 270:
        counterclockwise += 270 - a[i]
    elif a[i] > 0 and a[i] < 360:
        counterclockwise += 360 - a[i]

if clockwise == 360 or counterclockwise == 360:
    print("YES")
else:
    print("NO")

